time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"axis":{"id":"1126"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1129","type":"Grid"},{"attributes":{"data":{"bandwidth":[1,2],"bandwidth_text":["1","2"],"destination":["a","b"],"source":["a","b"]},"selected":{"id":"1507"},"selection_policy":{"id":"1506"}},"id":"1150","type":"ColumnDataSource"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1275","type":"Line"},{"attributes":{"overlay":{"id":"1459"}},"id":"1140","type":"BoxZoomTool"},{"attributes":{"factors":["a","b"]},"id":"1157","type":"FactorRange"},{"attributes":{"fill_alpha":{"field":"alpha"},"fill_color":{"field":"color"},"height":{"value":0.4},"line_alpha":{"value":0.6},"line_color":{"field":"color"},"line_width":{"value":3},"width":{"field":"duration"},"x":{"field":"start"},"y":{"field":"y"}},"id":"1132","type":"Rect"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1322","type":"AdaptiveTicker"}
